import wineParty from './wine_party.png';
import './App.css';

function App() {
  return (
    <div className="container">
      <div>
      <h3>Corked Up</h3>
      <p id="slogan">Helping you have the best wine experience wherever you are.</p>
      </div>

       <img id="wineParty" src={wineParty} alt="wine party image"/>
    </div>
  );
}

export default App;
